import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import App from './App';
import insert from './Insert';
const Webpages = () => {
    return(
        <Router>
            <Route exact path="/" component= {Home} />
            <Route path = "/app" component = {App} />
            <Route path = "/insert" component = {Insert} />
        </Router>
    );
};export default Webpages;
